import Header from '../components/Header';

const LayoutStyle = {
    margin: 20,
    padding: 20,
    border: '1px solid #ddd'
}

const Layout = (props) => {
    return (
        <div style={LayoutStyle}>
            <Header />
            { props.children }
        </div>
    );
}

export default Layout;
